import React from "react";
import {Text, Grid, Button} from "../elements";
import { getCookie, deleteCookie } from "../shared/Cookie";
import { useSelector, useDispatch } from "react-redux";
import { actionCreators as userActions } from "../redux/modules/user";

import {history} from "../redux/configureStore";
import { apiKey } from "../shared/firebase";
import Permit from "../shared/Permit";
import Logout from "../pages/Logout";
// import {Permit} from "../shared/Permit";

const Header = (props) => {

    const dispatch = useDispatch();
    const is_login = useSelector((state) => state.user.is_login);

    const _session_key = `firebase:authUser:${apiKey}:[DEFAULT]`;

    const is_session = sessionStorage.getItem(_session_key)? true : false;

    console.log(sessionStorage.getItem(_session_key));
    console.log(is_session);

    // const Logout = () => {
    //     apiKey.signOut()
    //         history.push('/');
    //   };

    if(is_login){  // 로그인 되어 있으면 header를 로그아웃으로 변경
        return (
            <Grid is_flex padding="16px" center>
                <Button text="home" _onClick={() => {
                      history.push("/");
                }}></Button>

                <Text margin='0px' size='40px' bold>SHORT</Text>

                <Button text="로그아웃" _onClick={() => {
                    history.push("/logout");
                    //Logout(); // 로그아웃 버튼 누르면 Logout함수 호출
                }}></Button>
            </Grid>
          );
    }


    return (
        <React.Fragment>
            <Grid is_flex padding ='4px 16px' center>

                    <Button text="home" _onClick={() => {
                      history.push("/");
                    }}></Button>

                    <Text margin='0px' size='40px' bold>SHORT</Text>

                    <Button text="로그인" _onClick={() => {
                      history.push("/login");
                    }}></Button>
                    <Button text="회원가입" _onClick={() => {
                      history.push("/signup");
                    }}></Button>

            </Grid>
        </React.Fragment>
    )
}

Header.defaultProps = {

}



export default Header;
